backend.tf.code:
terraform {
  backend "s3" {
    bucket = "cloud-ai-demo-infra"
    key    = "cloud-ai/terraform.tfstate"
    region = "us-east-1"
    # Optionally add encryption
    encrypt = false
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./providers.tf.code:
provider "aws" {
  region = "us-east-1"
}

provider "random" {
  # The random provider doesn't require any configuration
}

./module/ssm_parameter_store.code:
resource "random_string" "postfix" {
  length  = 3
  upper   = false
  lower   = true
  number  = false
  special = false
}

resource "aws_ssm_parameter" "parameter_from_cloud_ai" {
  name  = "parameter_from_CloudAI_${random_string.postfix.result}"
  type  = "String"
  value = "your_value_here"

  tags = {
    owner = "jeremy_wang"
  }
}
